INSERT INTO `emails` (`id`, `slug`, `subject`, `description`, `content`) VALUES
(1, 'new_customer_register', '[ClevverMail] - Customer registration nofitication', 'Email template for register new customer', '<p>\n	Dear,</p>\n<p>\n	&nbsp;</p>\n<p>\n	Thank you for registering with ClevverMail.</p>\n<p>\n	Your account has been created.</p>\n<p>\n	Please click to this link {{active_url}} to activate your account.</p>\n<p>\n	&nbsp;</p>\n<p>\n	sincerely, your ClevverMail Team</p>'),
(2, 'customer_reset_password', '[ClevverMail] - New password nofitication', 'Email template for customer reset password', '<p>\n	Dear, {{full_name}}</p>\n<p>\n	Your password of account in {{site_url}} has been reseted.</p>\n<p>\n	Your login: {{email}} Your password: {{password}}</p>\n<p>\n	Best regards,</p>\n<p>\n	Clevver Mail</p>'),
(3, 'new_incomming_notification', '[ClevverMail] - New incomming nofitication', 'Email template for incomming notification', '<p>\n	Dear, {{full_name}}</p>\n<p>\n	New incomming envelope has been created.</p>\n<p>\n	Please click to this link {{site_url}} to check it.</p>\n<p>\n	Best regards,</p>\n<p>\n	ClevverMail</p>'),
(4, 'scan_item_completed_notification', 'ClevverMail - Scan item completed notification', 'Scan item completed notification', '<p>\n	Dear {{full_name}},</p>\n<p>\n	&nbsp;</p>\n<p>\n	Your envelope id: {{envelope_code}} has been scan completed.</p>\n<p>\n	Login to view: <a href="https://www.clevvermail.com/?page_id=1439">https://www.clevvermail.com</a></p>\n<p>\n	&nbsp;</p>\n<p>\n	Kind regards,<br />\n	Your ClevverMail Team</p>\n<p>\n	&nbsp;</p>'),
(5, 'first_letter_notification', 'ClevverMail - First letter notification', 'The first letter notification', 'Dear {full_name},<br />\n<p>\n	&nbsp;</p>\n<p>\n	Your have received the first letter from your ClevverMail team.</p>\n<p>\n	Login to view: <a href="https://www.clevvermail.com/?page_id=1439">https://www.clevvermail.com</a></p>\n<p>\n	&nbsp;</p>\n<p>\n	Kind regards,<br />\n	Your ClevverMail Team</p>'),
(6, 'new_incomming_notification_for_notactivated', 'ClevverMail - New incomming notification', 'New incomming notification for not activated account', '<p>\n	Dear, {{full_name}}</p>\n<p>\n	New incomming envelope has been created.</p>\n<p>\n	Please <span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">completes the activation/registration</span> to view it</p>\n<p>\n	Best regards,</p>\n<p>\n	ClevverMail</p>\n<br />'),
(7, 'new_business_account_notification', 'ClevverMail - New business account activated', 'Send email notification when have new activated account', 'Dear team,<br />\n<p>\n	&nbsp;</p>\n<p>\n	New business account has been activated.</p>\n<p>\n	Email address: {{email}}</p>\n<p>\n	Postbox Name: {{postbox_name}}</p>\n<p>\n	Name: {{name}}</p>\n<p>\n	Company: {{company}}</p>\n<p>\n	&nbsp;</p>\n<p>\n	Best regards,</p>\n<p>\n	ClevverMail</p>'),
(8, 'new_business_account_notification_for_customer', 'ClevverMail - Your business account activated', 'Send email notification to customer when have new activated account', '<br />\n<p>\n	Dear,</p>\n<p>\n	&nbsp;</p>\n<p>\n	Your business account activated.</p>\n<p>\n	<span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Now your name comes on the door.</span></p>\n<p>\n	&nbsp;</p>\n<p>\n	Best regards,</p>\n<p>\n	ClevverMail</p>'),
(9, 'downgraded_business_account', 'ClevverMail - Downgraded business account', 'Send email notification when one customer downgraded business account', 'Dear team,<br />\n<p>\n	&nbsp;</p>\n<p>\n	This business account has been <span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><span style="color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">downgraded/canceled/deleted</span></span></p>\n<p>\n	Email address: {{email}}</p>\n<p>\n	Postbox Name: {{postbox_name}}</p>\n<p>\n	Name: {{name}}</p>\n<p>\n	Company: {{company}}</p>\n<p>\n	&nbsp;</p>\n<p>\n	Best regards,</p>\n<p>\n	ClevverMail</p>'),
(10, 'declare_customs_notification', 'ClevverMail - Request declare customs for envelope shipping', 'Request declare customs for envelope shipping', 'Dear {{full_name}},<br />\n<br />\n<p>\n	You have some auto request to shipping envelope.</p>\n<p>\n	Please access this link {{site_url}} to complete shipping request</p>\n<p>\n	&nbsp;</p>\n<p>\n	Regards,</p>\n<p>\n	ClevverMail Team</p>');
